import{_ as e,c as t,o as r,a5 as i}from"./chunks/framework._9XAAHMS.js";const l="/docs/assets/amf.B_3iP1kK.gif",f=JSON.parse('{"title":"华秋 PCB Active Manufacturing","description":"","frontmatter":{"tag":["插件","KiCad","开源","技术"]},"headers":[],"relativePath":"open-source/amf-plugin.md","filePath":"open-source/amf-plugin.md","lastUpdated":1720171325000}'),o={name:"open-source/amf-plugin.md"};function n(c,a,p,s,d,h){return r(),t("div",{"data-pagefind-body":!0},a[0]||(a[0]=[i('<h1 id="华秋-pcb-active-manufacturing" tabindex="-1">华秋 PCB Active Manufacturing <a class="header-anchor" href="#华秋-pcb-active-manufacturing" aria-label="Permalink to &quot;华秋 PCB Active Manufacturing&quot;">​</a></h1><h3 id="在-kicad-一键询价和下单" tabindex="-1">在 KiCad 一键询价和下单 <a class="header-anchor" href="#在-kicad-一键询价和下单" aria-label="Permalink to &quot;在 KiCad 一键询价和下单&quot;">​</a></h3><p>华秋 PCB Active Manufacturing 插件将帮助您：</p><ul><li>从您的设计中提取关键制造参数</li><li>在 KiCad 内获取华秋的实时报价</li><li>生成 Gerber 文件并将其与您的个人电路板设置一起上传到华秋</li></ul><p>上传完成后，您可以使用华秋 DFM 仔细检查您的制造文件，调整电路板参数，然后将其直接添加到您的华秋购物车。 <img src="'+l+'" alt="华秋插件"></p><h2 id="特色" tabindex="-1">特色 <a class="header-anchor" href="#特色" aria-label="Permalink to &quot;特色&quot;">​</a></h2><h3 id="自动参数提取" tabindex="-1">自动参数提取 <a class="header-anchor" href="#自动参数提取" aria-label="Permalink to &quot;自动参数提取&quot;">​</a></h3><p>启动插件时，将从您的 KiCad 设计中提取以下参数：</p><ul><li>层数</li><li>电路板尺寸（x，y）</li><li>板厚</li><li>最小走线宽度/间距</li><li>最小钻孔尺寸</li></ul><p><em>注意：这些参数无法从插件中编辑，因为它们是直接从您的 KiCad 设计中提取的。</em></p><h3 id="直接在-kicad-中获取实时报价" tabindex="-1">直接在 KiCad 中获取实时报价 <a class="header-anchor" href="#直接在-kicad-中获取实时报价" aria-label="Permalink to &quot;直接在 KiCad 中获取实时报价&quot;">​</a></h3><p>单击“更新价格”按钮，从华秋获取您的电路板的最新定价和交货时间。</p><p>您可以随时修改其他参数（例如阻焊层颜色、电路板数量等），然后单击按钮即可重新报价。所有选项均与<a href="https://www.hqpcb.com/" target="_blank" rel="noreferrer">华秋 PCB</a>同步。</p><p><em>注意：某些组合受到限制（例如白色丝印不能与白色阻焊层一起选择）。</em></p><p>###一键 Gerber 生成并同步到订单页面</p><p>单击“下订单”按钮生成 Gerber 和 NC 钻孔文件，并将其与您的电路板参数一起直接上传到华秋的订单页面。</p><p>一切都是同步的，因此不需要额外的调整。当然，您可以随意更改网站上的设置，然后继续订购。</p><p>支持以下区域：</p><ul><li>欧洲和美国：<a href="https://www.nextpcb.com/pcb-quote" target="_blank" rel="noreferrer">NextPCB</a></li><li>中国大陆 <a href="https://www.hqpcb.com/quote/" target="_blank" rel="noreferrer">华秋 PCB</a></li><li>日本：<a href="https://jp.nextpcb.com/pcb-quote#/pcb-quote/" target="_blank" rel="noreferrer">JP.NextPCB</a></li></ul><h2 id="安装" tabindex="-1">安装 <a class="header-anchor" href="#安装" aria-label="Permalink to &quot;安装&quot;">​</a></h2><p>从 <strong>为包保留</strong> 下载最新版本的 ZIP 文件，然后在 KiCad 中，从主窗口打开“插件和内容管理器”。最后，使用窗口底部的“从文件安装...”来安装 ZIP 文件。 <img src="https://github.com/HubertHQH/HQ-NextPCB/assets/125419974/97ef0ca3-380e-4f6f-a14b-6960271118fc" alt="图片"></p><h3 id="关于华秋-pcb" tabindex="-1">关于华秋 PCB <a class="header-anchor" href="#关于华秋-pcb" aria-label="Permalink to &quot;关于华秋 PCB&quot;">​</a></h3><p>华秋专注于可靠的多层 PCB 制造和组装，与 KiCad 一样，我们的目标是帮助工程师构建未来的电子产品。 华秋 PCB 正在与 KiCad 合作提供智能工具来简化从设计到物理产品的流程。华秋拥有 3 家主要从事原型设计、批量生产和 PCB 组装的工厂，并拥有超过 15 年的工程专业知识，相信我们的行业经验对于 KiCad 用户和 PCB 设计社区来说将是无价的。</p><p>我们是 <a href="https://www.nextpcb.com/blog/kicad-nextpcb-platinum-sponsorship" target="_blank" rel="noreferrer">KiCad 白金赞助商</a>。</p>',24)]))}const b=e(o,[["render",n]]);export{f as __pageData,b as default};
